const LogoutButton = () => {
    
    const {logout} = useAuth0();
    return (
        <Button
            onClick={() => logout()}
            id = "qsLogoutBtn"
            variant = "danger"
            className = "btn-margin"
        >
            Log Out
        </Button>    
    );
};

export default LogoutButton;
